import React from "react";
import Header from "./Header";
import Input from "./Input";
import Footer from "./Footer";

function App(){
    return (
        <div>
            <Header />
            <div class="container">
                <Input />
                <Input />
            </div>
            <Footer />
        </div>
        
    );
}

export default App;
